import Jumbo from "../components/Jumbo";
import ListGroup from "react-bootstrap/ListGroup";
import Container from "react-bootstrap/Container";
import sprite from "../images/sprite_60fps.svg";

function PlansAndPricing() {
  return (
    <div>
      <Jumbo headingText={"Plans & Pricing"} />
      <div
        class="shapeshifter play"
        // style="background-image: url(sprite_60fps.svg)"
        style={{ backgroundImage: `url(${sprite})` }}
      ></div>
      <Container>
        <ListGroup>
          <ListGroup.Item>Ongoing Maintenance Time</ListGroup.Item>
          <ListGroup.Item>Pages Populated For You</ListGroup.Item>
          <ListGroup.Item>Professional Stock Images</ListGroup.Item>
          <ListGroup.Item>Plugins</ListGroup.Item>
          <ListGroup.Item>File Storage / Bandwidth</ListGroup.Item>
        </ListGroup>
      </Container>
      <style jsx>{`
        h1 {
          text-align: center;
        }
        @keyframes play48 {
          0% {
            background-position: 0px 0px;
          }
          100% {
            background-position: -16320px 0px;
          }
        }
        .shapeshifter {
          animation-duration: 800ms;
          animation-timing-function: steps(48);
          width: 340px;
          height: 340px;
          background-repeat: no-repeat;
        }
        .shapeshifter.play {
          animation-name: play48;
        }
      `}</style>
    </div>
  );
}

export default PlansAndPricing;
